    width: !isNaN(props.width) ? +props.width : 48,
    height: !isNaN(props.height) ? +props.height : 48,
  }));
};

(Icon48NewsfeedOutline as any).mountIcon = mountIcon;

export default Icon48NewsfeedOutline;
